var Cons = function(){
    var self = this;
    self.data = [
        {code:'NONE', des:"无"},
        {code:'DB', des:'数据库'},
        {code:'CACHE', des:'缓存'}
    ];

    for(var i = 0; i < self.data.length; i++)
    {
        var set = self.data[i];
        self[set.code] = set;
    }
};
module.exports = new Cons();

